  const [generalInformation , setGeneralInformation] = useState("");
  useEffect(() => {
    instanceAxios.get("missions.json").then((response) => {
      setMissions(response.data)
    });
  }, []);

  useEffect(() => {
    instanceAxios.get("shifts.json").then((response) => {
      response.data.map((mission, index)=>{
        //if mission.id === params.
      })
      console.log(response.data)
      setGeneralInformation(response.data)
    });
  }, []);

  console.log(missions);
  console.log(generalInformation)

  return (
    <>
    <NavBar></NavBar>
      <div className="grid grid-cols-1 gap-4 place-content-center mx-auto p-8 xl:px-0 max-w-lg">
        <ShiftMissionList generalInformation={"null"} missions={missions}></ShiftMissionList>
      </div>
    </>
  );
};
export default ShiftDetail;
